import React from 'react';
import { Helmet } from 'react-helmet';
import Header from './components/header';

const Index = () => {
  return (
    <div>
      <style jsx global>{`
        @font-face {
          font-family: 'k2d-bold';
          src: url('/fonts/K2D-Bold.ttf');
          font-weight: bold;
          font-style: normal;
          font-display: swap;
        }
        @font-face {
          font-family: 'k2d-reg';
          src: url('/fonts/K2D-Regular.ttf');
          font-weight: bold;
          font-style: normal;
          font-display: swap;
        }
        @font-face {
          font-family: 'k2d-med';
          src: url('/fonts/K2D-Medium.ttf');
          font-weight: bold;
          font-style: normal;
          font-display: swap;
        }
        @font-face {
          font-family: 'k2d-bold';
          src: url('/fonts/K2D-Bold.ttf');
          font-weight: bold;
          font-style: normal;
          font-display: swap;
        }
      `}</style>
      <Helmet>
        <style>{'body { background-color: #fff; }'}</style>
      </Helmet>
      <Header />
    </div>
  );
};

export default Index;
